        $rootScope.generateUUID = function () { // Public Domain/MIT
            var d = new Date().getTime();
            if (typeof performance !== 'undefined' && typeof performance.now === 'function') {
                d += performance.now(); //use high-precision timer if available
            }
            return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function (c) {
                var r = (d + Math.random() * 16) % 16 | 0;
                d = Math.floor(d / 16);
                return (c === 'x' ? r : (r & 0x3 | 0x8)).toString(16);
            });
        };
        $rootScope.filterArray = function (array, keys, values) {
            var result = [];
            if (array) {
                for (var i = 0; i < array.length; i++) {
                    var matched = true;
                    for (var j = 0; j < keys.length; j++) {
                        if (array[i][keys[j]] !== values[j]) {
                            matched = false;
                            break;
                        }
                    }
                    if (matched) {
                        result.push(array[i]);
                    }
                }
            }
            return result;
        };
        $rootScope.findObjectByKey = function (array, key, value) {
            if (Array.isArray(key)) {
                for (var i = 0; i < array.length; i++) {
                    var isMatch = true;
                    angular.forEach(key, function (e, j) {
                        isMatch = array[i][key[j]] == value[j];
                    });
                    if (isMatch) {
                        return array[i];
                    }
                }
            } else {
                for (var i = 0; i < array.length; i++) {
                    if (array[i][key] == value) {
                        return array[i];
                    }
                }
            }
            return null;
        }
        $rootScope.removeObjectByKey = function (array, key, value) {
            if (Array.isArray(key)) {
                for (var i = 0; i < array.length; i++) {
                    var isMatch = true;
                    angular.forEach(key, function (e, j) {
                        isMatch = array[i][key[j]] == value[j];
                    });
                    if (isMatch) {
                        array.splice(i, 1);
                        break;
                    }
                }
            } else {
                for (var i = 0; i < array.length; i++) {
                    if (array[i][key] == value) {
                        array.splice(i, 1);
                        break;
                    }
                }
            }
            for (var i = 0; i < array.length; i++) {
                if (array[i][key] == value) {
                    array.splice(i, 1);
                    break;
                }
            }
        }

