app.component('mediaNavs', {
    templateUrl: '/app/app-shared/components/media-navs/media-navs.html',
    controller: ['$rootScope', '$scope', 'ngAppSettings', 'MediaService', 
        function ($rootScope, $scope, ngAppSettings, mediaService) {
        var ctrl = this;
        mediaService.init('media');
        ctrl.request = {
            pageSize: '10',
            pageIndex: 0,
            status: 'Published',
            orderBy: 'CreatedDateTime',
            direction: 'Desc',
            fromDate: null,
            toDate: null,
            keyword: ''
        };
        ctrl.medias = [];
        ctrl.activeMedia = function (media) {
            var currentItem = null;
            if (ctrl.data === null || ctrl.isSingle) {
                ctrl.data = [];
            }
            $.each(ctrl.data, function (i, e) {
                if (e.mediaId === media.id) {
                    e.isActived = media.isActived;
                    currentItem = e;
                    return false;
                }
            });
            if (currentItem === null) {
                currentItem = {
                    description: media.description !== 'undefined' ? media.description : '',
                    image: media.filePath,
                    mediaId: media.id,
                    product: ctrl.id,
                    specificulture: media.specificulture,
                    position: 0,
                    priority: ctrl.data.length + 1,
                    isActived: true
                };
                ctrl.data.push(currentItem);
            }
            if(ctrl.isSingle){
                if(!media.isActived){
                    ctrl.output = '';
                    ctrl.data = [];
                }
                else{
                    ctrl.output = ctrl.data[0].image;
                    //ctrl.loadMedias(ctrl.request.pageIndex);
                }
            }
        };
        ctrl.loadMedias = async function (pageIndex) {
            if(!ctrl.prefix){
                ctrl.prefix = 'media_navs';
            }
            if (pageIndex !== undefined) {
                ctrl.request.pageIndex = pageIndex;
            }
            if (ctrl.request.fromDate !== null) {
                var d = new Date(ctrl.request.fromDate);
                ctrl.request.fromDate = d.toISOString();
            }
            if (ctrl.request.toDate !== null) {
                ctrl.request.toDate = ctrl.request.toDate.toISOString();
            }
            if ($rootScope.globalSettings) {
                $rootScope.isBusy = true;
                var resp = await mediaService.getList(ctrl.request);
                if (resp && resp.isSucceed) {
                    ctrl.medias = resp.data;
                    if (ctrl.data) {
                        angular.forEach(ctrl.medias.items, function (value, key) {
                            var temp = ctrl.data.filter(function (item) {
                                return item.mediaId === value.id;
                            })[0];
                            value.isActived = temp !== undefined;
                        });
                    }
                    $rootScope.isBusy = false;
                    $scope.$apply();
                }
                else {
                    if (resp) { $rootScope.showErrors(resp.errors); }
                    $rootScope.isBusy = false;
                    $scope.$apply();
                }
            }
        };
    }],
    bindings: {
        data: '=',
        prefix: '=',
        sourceFieldName:'=',        
        isSingle: '=',
        output: '=',
        loadMedia: '&',
        onDelete: '&',
        onUpdate: '&'
    }
});
'use strict';
app.controller('MediaController', ['$scope', '$rootScope', 'ngAppSettings', '$routeParams', 'MediaService', 'CommonService',
    function ($scope, $rootScope, ngAppSettings, $routeParams, service, commonService) {
        BaseCtrl.call(this, $scope, $rootScope, $routeParams, ngAppSettings, service);

        $scope.activedData = {
            title: '',
            description: '',
            status: 2,
            mediaFile: {
                file: null,
                fullPath: '',
                folderName: 'Media',
                fileFolder: '',
                fileName: '',
                extension: '',
                content: '',
                fileStream: ''
            }
        };
        // multipart form   
        $scope.formFile = null; 
        $scope.relatedMedias = [];
        $scope.save = async function (data) {
            $rootScope.isBusy = true;
            if($scope.validate){
                $scope.isValid = await $rootScope.executeFunctionByName('validate', $scope.validateArgs, $scope)
            }
            if($scope.isValid){
                var resp = await service.save(data, $scope.formFile);
                if (resp && resp.isSucceed) {
                    $scope.activedData = resp.data;
                    $rootScope.showMessage('success', 'success');
    
                    if ($scope.saveSuccessCallback) {
                        $rootScope.executeFunctionByName('saveSuccessCallback', $scope.saveSuccessCallbackArgs, $scope);
                    }
                    $rootScope.isBusy = false;
                    $scope.$apply();
                } else {
                    if($scope.saveFailCallback){
                        $rootScope.executeFunctionByName('saveFailCallback', $scope.saveSuccessCallbackArgs, $scope)
                    }
                    if (resp) {
                        $rootScope.showErrors(resp.errors);
                    }
                    $rootScope.isBusy = false;
                    $scope.$apply();
                }
            }
            else{
                $rootScope.showErrors(['invalid model']);
                $rootScope.isBusy = false;
                $scope.$apply();
            }
        };
        $scope.uploadMedia = async function () {
            $rootScope.isBusy = true;
            var resp = await service.uploadMedia($scope.mediaFile);
            if (resp && resp.isSucceed) {
                //$scope.activedMedia = resp.data;
                $scope.getList();
                $scope.$apply();
            }
            else {
                if (resp) { $rootScope.showErrors(resp.errors); }
                $rootScope.isBusy = false;
                $scope.$apply();
            }
        };
        $scope.selectFile = function (file, errFiles) {
            if (file !== undefined && file !== null) {
                $scope.mediaFile.folder = 'Media';
                $scope.mediaFile.file = file;
                $scope.getBase64(file);
            }
        };
        $scope.getBase64 = function (file) {
            if (file !== null && $scope.postedFile) {
                $rootScope.isBusy = true;
                var reader = new FileReader();
                reader.readAsDataURL(file);
                reader.onload = function () {
                    var index = reader.result.indexOf(',') + 1;
                    var base64 = reader.result.substring(index);
                    $scope.activedMedia.mediaFile.fileName = $rootScope.generateKeyword(file.name.substring(0, file.name.lastIndexOf('.')), '-');
                    $scope.activedMedia.mediaFile.extension = file.name.substring(file.name.lastIndexOf('.'));
                    $scope.activedMedia.mediaFile.fileStream = reader.result;
                    $rootScope.isBusy = false;
                    $scope.$apply();
                };
                reader.onerror = function (error) {
                    $rootScope.showErrors([error]);
                    $rootScope.isBusy = false;
                };
            }
            else {
                return null;
            }
        };
        $scope.togglePreview = function (item) {
            item.isPreview = item.isPreview === undefined ? true : !item.isPreview;
        };
        $scope.clone = async function (id) {
            $rootScope.isBusy = true;
            var resp = await service.cloneMedia(id);
            if (resp && resp.isSucceed) {
                $scope.activedMedia = resp.data;
                $rootScope.showMessage('Update successfully!', 'success');
                $rootScope.isBusy = false;
                $scope.$apply();
                //$location.path('/portal/media/details/' + resp.data.id);
            }
            else {
                if (resp) { $rootScope.showErrors(resp.errors); }
                $rootScope.isBusy = false;
                $scope.$apply();
            }
        };
        $scope.saveSuccessCallback = function(){
            $scope.activedData = {
                title: '',
                description: '',
                status: 2,
                mediaFile: {
                    file: null,
                    fullPath: '',
                    folderName: 'Media',
                    fileFolder: '',
                    fileName: '',
                    extension: '',
                    content: '',
                    fileStream: ''
                }
            };
            $scope.getList();
        }
        $scope.removeCallback = function(){
            $scope.getList();
        }
    }]);

'use strict';
app.factory('MediaService', ['$rootScope', 'CommonService', 'BaseService',
    function ($rootScope, commonService, baseService) {

        var serviceFactory = Object.create(baseService);
        serviceFactory.init('media');
        var _cloneMedia = async function (id) {
            var req = {
                method: 'GET',
                url: serviceFactory.prefixUrl + '/clone/' + id
            };
            return await commonService.getApiResult(req);
        };
        var _save = async function(objData, file){
            var url = this.prefixUrl + '/save';
            var fd = new FormData();
            var file =objData.mediaFile.file;
            objData.mediaFile.file = null;
            fd.append('model', angular.toJson(objData));
            fd.append('file', file);
            return await serviceFactory.ajaxSubmitForm(fd, url);
        }
        var _uploadMedia = async function (mediaFile, file) {
            //var container = $(this).parents('.model-media').first().find('.custom-file').first();
            if (mediaFile.file !== undefined && mediaFile.file !== null) {
                // Create FormData object
                var files = new FormData();

                // Looping over all files and add it to FormData object
                files.append(mediaFile.file.name, file);

                // Adding one more key to FormData object
                files.append('fileFolder', mediaFile.folder); files.append('title', mediaFile.title);
                files.append('description', mediaFile.description);

                var req = {
                    url: this.prefixUrl + '/media/upload', //'/tts/UploadImage',
                    method: "POST",
                    headers: {
                        'Content-Type': 'multipart/form-data'
                    },
                    contentType: false, // Not to set any content header
                    processData: false, // Not to process data
                    data: files,
                };

                return await commonService.getApiResult(req);
            }
        };
        serviceFactory.cloneMedia = _cloneMedia;
        serviceFactory.uploadMedia = _uploadMedia;
        serviceFactory.save = _save;
        return serviceFactory;

    }]);


